import React, { FC } from "react";
import NoNavLayout from "../../components/Layouts/NoNavLayout";
import { useKeyboardForm } from "../../lib/keyboardFormStore";
import { Flex } from "@rsbear/betsy";

const CreateKeyboard: FC<any> = () => {
  const { values, changeStringInArray, setString } = useKeyboardForm();

  async function onSubmit() {
    event?.preventDefault();
    console.log("values", values);
  }

  return (
    <NoNavLayout>
      <h1>Create Keyboard</h1>
      <Flex>
        <div>part one --- </div>
        <div>part two --- </div>
        <div>part three</div>
      </Flex>
      <form onSubmit={onSubmit}>
        <p>name</p>
        <input
          type="text"
          placeholder="Name"
          name="name"
          value={values.name}
          onChange={(e) => setString(e)}
        />
        <p>size</p>
        <input
          type="text"
          placeholder="size"
          name="size"
          value={values.size}
          onChange={(e) => setString(e)}
        />
        <p>extra plates</p>
        <button
          type="button"
          name="extraPlates"
          value={1}
          onClick={(e) => setBoolean(e)}
        >
          {!values.extraPlates ? "yes" : "yes already selected"}
        </button>
        <button
          type="button"
          name="extraPlates"
          value={null}
          onClick={(e) => setBoolean(e)}
        >
          {!values.extraPlates ? "no - selected" : "no"}
        </button>
        <input
          type="text"
          placeholder="colors"
          value={values.colors[0]}
          tabIndex={0}
          onChange={(e) => changeStringInArray(e, e.target.value)}
        />
        <button type="submit">submit</button>
      </form>
    </NoNavLayout>
  );
};

export default CreateKeyboard;
